Array : 우리가 알고 있는 배열, 리스트의 형태를 가지고 있다. Function : Javascript에서는 Function Object가 존재하지만 결국 Function도 Object. Object : Map처럼 사용하는 즉, key : value의 형태로 사용하고 있는 Object. var a = { c: 13 } // assign the reference of a new object to `a`
var b = a // copy the reference of the object inside `a` to new variable `b`
b.c = 37 // modify the contents of the object `b` refers to
console.log(a) // => { c: 37 } var a = [];
var b = a; a.push(1); console.log(a); // [1]
console.log(b); // [1]
console.log(a === b); // true function changeAgeImpure(person) { person.age = 25; return person;
}
var alex = { name: 'Alex', age: 30
};
var changedAlex = changeAgeImpure(alex); console.log(alex); // -> { name: 'Alex', age: 25 }
console.log(changedAlex); // -> { name: 'Alex', age: 25 } 원시타입과는 다르게 복사한 것을 변경을 했더니 기존 객체에도 영향이 간다. 이유는 같은 값의 주소 를 복사했기 때문이다. 🙏 Reference ImD/Dev-Docs - javascript Type

